import './button.css';
import Header from './Header';
import React from 'react';
function EmButton() {
  return (
    <button className='btn'>
      Emergency
    </button>
  );
}
function LogButton(){
    return (<button className='mtl'>
        Log In
    </button>
    );
}

export default function MyApp() {
    return (
        <div>
            <Header /> {/* Include the Header component */}
            <div className='first'>
                <EmButton />
                <div className='sec'>
                    <LogButton />
                </div>
            </div>
        </div>
    );
}
